        wiki: {
          published: '19 Mar 2015, 16:50',
          summary:
            'To Pimp a Butterfly is the third studio album by American hip hop artist, Kendrick Lamar. The album was released on March 16, 2015, by Top Dawg Entertainment, Aftermath Entertainment, and distributed by Interscope Records. Upon its release, To Pimp a Butterfly received rave reviews from music critics. Lamar has described the album, which incorporates elements of funk, spoken word poetry and jazz, as "honest, fearful and unapologetic." In an interview with Rolling Stone magazine <a href="http://www.last.fm/music/Kendrick+Lamar/To+Pimp+a+Butterfly">Read more on Last.fm</a>.',
          content:
            "To Pimp a Butterfly is the third studio album by American hip hop artist, Kendrick Lamar. The album was released on March 16, 2015, by Top Dawg Entertainment, Aftermath Entertainment, and distributed by Interscope Records. Upon its release, To Pimp a Butterfly received rave reviews from music critics. Lamar has described the album, which incorporates elements of funk, spoken word poetry and jazz, as \"honest, fearful and unapologetic.\" In an interview with Rolling Stone magazine, Kendrick indicated that the title was a play on Harper Lee's novel, To Kill a Mockingbird. He was quoted as saying, \"Just putting the word 'pimp' next to 'butterfly'… It's a trip. That's something that will be a phrase forever. It'll be taught in college courses — I truly believe that.\"\n\nOn Metacritic, which assigns a normalized rating out of hundreds of reviews from music critics, the album has an average score of 96, indicating \"universal acclaim\". Anthony Fantano of The Needle Drop gave it a perfect score, making it the third 10/10 he's given to a contemporary album. On music-reviewing website Rate Your Music, To Pimp A Butterfly has reached spot #13 on the list of the highest reviewed albums on the site. <a href=\"http://www.last.fm/music/Kendrick+Lamar/To+Pimp+a+Butterfly\">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.",
        },
